<template>
    <view>
        <view class="bg">
            <view class="name">总金额（元）</view>
            <view class="money">{{userInfo.money}}</view>
        </view>
        <view class="my-box">
            <view class="item">
                <view>
                    <text class="name">
                        可提现金额
                    </text>
                    <text>
                        ￥{{userInfo.out_money}}
                    </text>
                </view>
                <view class="tag">
                    <view class="btn" @click="open">申请提现</view>
                </view>
            </view>
            <view class="item">
                <view>
                    <text class="name">
                        限时余额
                    </text>
                    <text>
                        ￥{{userInfo.out_money}}
                    </text>
                </view>
                <view class="tag">
                    <span class="iconfont">
                        未激活 请通知门店店长激活后方可使用
                    </span>
                </view>
            </view>
            <view class="item">
                <view>
                    <text class="name">
                        限时余额
                    </text>
                    <text>
                        ￥{{999.99}}
                    </text>
                </view>
                <view class="tag">
                    <span class="iconfont">
                        2019-12-12 00:00:00 后过期
                    </span>
                </view>
            </view>
            <view class="item" @click="_goPage('user_record')">
                <view class="name">提现记录</view>
                <view class="tag">
                    <i class="iconfont icon-ddx-shop-content_arrows"></i>
                </view>
            </view>
            <view class="item" @click="_goPage('user_expenses_record')">
                <view class="name">消费记录</view>
                <view class="tag">
                    <i class="iconfont icon-ddx-shop-content_arrows"></i>
                </view>
            </view>
        </view>

        <!-- 申请提现弹框 输入提现金额 -->
        <uni-popup ref="getMoneyToWx" type="center" :custom="true">
            <view class="get-money-to-wx">
                <view class="box">
                    <view class="input-box">
                        <input type="number" class="input" focus placeholder="请输入提现金额"  v-model="money"/>
                    </view>
                    <view class="btn" @click="getMoney">
                        提现
                    </view>
                </view>
            </view>
        </uni-popup>
    </view>
</template>

<script>
    import { mapState } from 'vuex'
    import uniPopup from '@/components/uni-popup/uni-popup.vue'

    export default {
        name: "user_money", // 钱包
        data(){
            return{
                money: '',
            }
        },
        methods:{
            _goPage(url, query = {}){
                this.$openPage({name:url, query})
            },
            open(){
                this.$refs.getMoneyToWx.open()
            },
            close(){
                this.$refs.getMoneyToWx.close()
            },
            async getMoney(){
                if (this.money === ''){
                    this.close()
                    this.msg('请输入提现金额')
                    return
                }
                if (parseFloat(this.money) > parseFloat(this.userInfo.out_money)){
                    this.close()
                    this.msg('申请提现金额大于可提现金额')
                    return
                }
                let data  = {
                    money: this.money
                }
                await this.$minApi.applyMoney(data).then(res => {
                    if (res.code === 200) {
                        this.close()
                        this.msg('申请成功')
                    }
                })
                this.close()
            },
        },
        computed: {
            ...mapState(['userInfo'])
        },
        components: {
            uniPopup,

        }
    }
</script>

